import * as React from "react";
import Typography from "@mui/material/Typography";
import {
  Button,
  Card,
  CardActions,
  CardContent,
  CardMedia,
} from "@mui/material";
import dateFormat from "dateformat";
// import PhotoService from "../services/photoService";
import PhotoData from "../types/photoData";
import axios from "axios";

// every card has:
// image, like button, title, explanation, date

// make another component that takes a start and end date and returns the images in that set (inclusive)

export default function PhotoCard() {
  const [photos, setPhotos] = React.useState<PhotoData[]>([]);

  React.useEffect(() => {
    axios
      .get<PhotoData[]>(
        `https://api.nasa.gov/planetary/apod?api_key=ykzQINaucAEoc1RW6I3CqVke24wjlu9JAyrDVcKd&start_date=2022-01-02`
      )
      .then((response) => {
        console.log(response.data);
        setPhotos(response.data);
      });
  }, []);

  var mydate = new Date("2014-04-03");

  return (
    <Card sx={{ maxWidth: 800, margin: "auto" }}>
      <CardMedia
        component="img"
        // height="600"
        image="https://apod.nasa.gov/apod/image/2201/LeonardTail_Hattenbach_960.jpg"
        alt="green iguana"
      />
      <CardContent>
        <Typography
          sx={{
            fontSize: "40px",
          }}
          gutterBottom
          variant="h3"
          component="div"
        >
          Lizard
        </Typography>
        <Typography
          sx={{
            fontSize: "40px",
          }}
          gutterBottom
          variant="h3"
          component="div"
        >
          {dateFormat(mydate, "dddd, mmmm dS, yyyy")}
        </Typography>
        <Typography variant="body2" color="text.secondary">
          Lizards are a widespread group of squamate reptiles, with over 6,000
          species, ranging across all continents except Antarctica
        </Typography>
      </CardContent>
      <CardActions>
        <Button variant="contained" size="small">
          Like
        </Button>
      </CardActions>
    </Card>
  );
}
